import React from "react";
import { Text, Box, Container, Center } from "native-base";
import { Dimensions } from "react-native-web";

const { width, height } = Dimensions.get("window");

const App = () => {
  return (
    <Container w={width / 2} h={height / 2} borderWidth="1" margin={auto}>
      <Center>
        <Text>FA</Text>
      </Center>
    </Container>
  );
};

export default App;
